import React from 'react';

import './footer.css'

export const Footer = () => {
    return (
        <div className="container">
            <div className="contact">
                <h2>@HUSHPUPPIESCO</h2>
                <div className="icons-container">
                    <i class="fab fa-facebook-f"></i>
                    <i class="fab fa-instagram-square"></i>
                </div>
            </div>
        </div>
    )
}
